CREATE TABLE  `SiPAS`.`proveedores` (
  `nombre_proveedor` varchar(30) NOT NULL,
  `direccion` varchar(35) NOT NULL,
  `telefono` int(11) NOT NULL,
  `fax` varchar(20) NOT NULL,
  `id_proveedores` varchar(15) NOT NULL,
